    if (!temp_chip)
        return -ENOMEM;

    /* Initialize the temporary chip structure */
    temp_chip->base_layout = chip->base_layout;
    memcpy(&temp_chip->base_layout.ecc_enc, &chip->base_layout.ecc_enc, sizeof(temp_chip->base_layout.ecc_enc));
    memcpy(&temp_chip->base_layout.ecc_dec, &chip->base_layout.ecc_dec, sizeof(temp_chip->base_layout.ecc_dec));
    memcpy(&temp_chip->base_layout.ecc_calc, &chip->base_layout.ecc_calc, sizeof(temp_chip->base_layout.ecc_calc));
