    memcpy(&temp_chip->base_layout.ecc_calc, &chip->base_layout.ecc_calc, sizeof(temp_chip->base_layout.ecc_calc));
    memcpy(&temp_chip->base_layout.ecc_gen, &chip->base_layout.ecc_gen, sizeof(temp_chip->base_layout.ecc_gen));
    memcpy(&temp_chip->base_layout.ecc_calc, &chip->base_layout.ecc_calc, sizeof(temp_chip->base_layout.ecc_calc));

    /* Allocate an ECC layout for the UUID */
    ecc_layout = chip->base_layout;
    ecc_layout.eccbytes = 0;
    ecc_layout.eccbytes = 0;

    /* Allocate a BBT info structure */
    bbt_info = kzalloc(sizeof(*bbt_info), GFP_KERNEL);
    if (!bbt_info) {
