        kfree(temp_chip);
        return ret;
    }

    /* Copy the UUID to the user buffer */
    strncpy(uuid, uuid_buffer, uuid_len);

    /* Free the allocated memory */
    kfree(bbt_info);
    kfree(temp_chip);

    return 0;
}

